static inline OBMol* convertToOBMol(const string input, const string format)
{
    OBMol *mol;
    OBConversion conv;
    istringstream molstream (input);

    mol = new OBMol();

    conv.SetInFormat(format.c_str());

    conv.Read (mol, &molstream);

    return mol;
}

static inline string convertFromOBMol(OBMol *input, const string format)
{
    OBConversion conv;
    ostringstream molstream;

    conv.SetOutFormat(format.c_str());

    conv.Write (input, &molstream);

    return molstream.str();
}

