extern "C" unsigned int
ob_num_H_donors (char *smiles)
{
    OBMol *mol;
    string tmpStr (smiles);
    unsigned int numHdonors = 0;

    mol = convertToOBMol(tmpStr,"SMI");

    FOR_ATOMS_OF_MOL(a, mol)
    {
        if(a->IsHbondDonor()) numHdonors++;
    }

    delete mol;

    return (numHdonors);
}

